import React, {Component} from 'react';
import '../scss/binario.scss'
class Binario extends Component {
    render() {
        return (
            <div className='binario'>
               <h3> conversione base [ 10 --> 2 ]</h3>
                <form>
                    <input type="text" placeholder="Your Number" className="txtb" name='base10'/>
                </form>
            </div>
        );
    }
}

export default Binario;
